import React, { useEffect } from 'react'
import axios from 'axios'

export const postData =({phoneObject})=>{
    useEffect(()=>{
        axios.post('http://localhost:3001/persons',phoneObject)
        .then(response=>{
            console.log(response)
        })
    })
}
